import React from 'react';
import '../styles/Postagem2css'; // Importe o arquivo CSS aqui

function Feed() {
    return (
        <div className="App">
            <header id="navbar">
                <h1>Feed</h1>
            </header>
            <main></main>
            <div id="endPage" aria-hidden="true"></div>
            {/* O script.js não é necessário no React, pois o código JavaScript é gerenciado de forma diferente */}
        </div>
    );
}

export default Feed
